import * as React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';

export default function SimplePaper(props) {
  return (
    <Box className='Notes-card'>
    <Paper elevation={3}  > 
     <div className="notes-cont">
       <h2>{props.t1}</h2>
       <br />
       <h4>
         {props.t2}
       </h4>
     </div>
      </Paper>
    </Box>
  );
}
